import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Button } from './components/Button';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button variant='add-button' color='red' intensity={500} />
      </header>
    </div>
  );
}

export default App;
